import React from "react";
import "./Contact.css";
import Footer from "../components/Footer";

const Contact = () => {
  return (
    <>
    <div className="contact-page">
      {/* Get in Touch Section */}
      <section className="get-in-touch">
        <h1>Get in Touch</h1>
        <p>
          Reach out to us for any culinary inquiries or assistance. Our team is
          ready to provide exceptional service and support.
        </p>
      </section>

      {/* Map and Form Section */}
      <section className="map-and-form">
        {/* Map Section */}
        {/* <div className="map-container"> */}
          {/* <h2>Author! West</h2>
          <p>Mumbai, Maharashtra 600047</p> */}
          {/* <div className="map"> */}
            {/* <img
              src="https://onefivenine.com/images/GoogleMapImages/19_0972_9.jpg" // Replace with your map image
              alt="Location Map"
            />
          </div>

        </div> */}

        {/* Contact Form Section */}
        <div className="form-container">
          <h2>Get in Touch</h2>
          <p>We'd love to hear from you!</p>
          <form>
            <div className="form-group">
              <label htmlFor="name">Name</label>
              <input type="text" id="name" placeholder="Enter your name" />
            </div>
            <div className="form-group">
              <label htmlFor="email">Email</label>
              <input type="email" id="email" placeholder="Enter your email" />
            </div>
            <div className="form-group">
              <label htmlFor="message">Message</label>
              <textarea
                id="message"
                placeholder="Type your message"
                rows="5"
              ></textarea>
            </div>
            <button type="submit">Submit</button>
          </form>
        </div>
      </section>
    </div>
    <Footer/>
    </>
  );
};

export default Contact;
